INSERT INTO `channel` VALUES ('1000000000001','Bug码',NULL,'1701176517959','豫章故郡，洪都新府。星分翼轸，地接衡庐。襟三江而带五湖，控蛮荆而引瓯越。物华天宝，龙光射牛斗之墟；人杰地灵，徐孺下陈蕃之榻。雄州雾列，俊采星驰。台隍枕夷夏之交，宾主尽东南之美。都督阎公之雅望，棨戟遥临；宇文新州之懿范，襜帷暂驻。十旬休假，胜友如云；千里逢迎，高朋满座。腾蛟起凤，孟学士之词宗',NULL,'1701176993424','1701178900100','1701778536984','2023-12-01 15:34:49','2023-12-09 08:34:19'),('1695627840947','叶子',NULL,'1695627840943','某些插件会通过 app.config.globalProperties 为所有组件都安装全局可用的属性。举例来说，我们可能为了请求数据而安装了 this.$http，或者为了国际化而安装了 this.$translate。为了使 TypeScript 更好地支持这个行为，Vue 暴露了一个被设计为可以通过 TypeScript 模块扩展来扩展的 ComponentCustomProperties 接口：',NULL,'1697263947397','1697264013066','1701514632547','2023-09-25 07:44:00','2024-02-11 08:34:10'),('1701180369127','小夜刀叉',NULL,'1701180369121','滕王阁序是唐代文学家王勃创作的一篇骈文。文章由洪都的地势、人才写到宴会，写滕王阁的壮丽，眺望的广远，扣紧秋日，景色鲜明；再从宴会娱游写到人生遇合，抒发身世之感；接着写作者的遭遇并表白要自励志节，最后以应命赋诗和自谦之辞作结',NULL,'1701499667928',NULL,'1701506474083','2023-11-28 14:06:09','2023-12-09 08:07:42'),('1701180385007','音乐',NULL,'1701180385005','coderhub官方频道',NULL,NULL,NULL,'1701444637905','2023-11-28 14:06:25','2023-12-01 15:31:35'),('1701180398880','电影和节目',NULL,'1701180398878',NULL,NULL,NULL,NULL,'1701444248199','2023-11-28 14:06:38','2023-12-01 15:24:08'),('1701180404317','游戏',NULL,'1701180404316',NULL,NULL,NULL,NULL,'1702110229320','2023-11-28 14:06:44','2023-12-09 08:23:49'),('1701180408476','新闻',NULL,'1701180408473',NULL,NULL,NULL,NULL,NULL,'2023-11-28 14:06:48','2023-11-28 14:06:48'),('1701180412727','体育',NULL,'1701180412726',NULL,NULL,NULL,NULL,'1701438630579','2023-11-28 14:06:52','2023-12-01 13:50:30'),('1701180418834','学习',NULL,'1701180418831',NULL,NULL,NULL,NULL,NULL,'2023-11-28 14:06:58','2023-11-28 14:06:58'),('1701350273438','曹操',NULL,'1701350273436',NULL,NULL,NULL,NULL,NULL,'2023-11-30 13:17:53','2023-11-30 13:17:53'),('1701861356240','孙权',NULL,'1701861356232',NULL,NULL,NULL,NULL,NULL,'2023-12-06 11:15:56','2023-12-06 11:15:56'),('1702193969536','guobin',NULL,'1702193969526',NULL,NULL,NULL,NULL,NULL,'2023-12-10 07:39:29','2023-12-10 07:39:29'),('1702194