INSERT INTO `comment` VALUES ('1701179184841','豫章故郡，洪都新府。星分翼轸(zhěn)，地接衡庐。襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，','1701176517959','1697263947397',NULL,'2023-11-28 13:46:24','2023-11-28 13:46:24',NULL),('1701179195002','豫章故郡，洪都新府。星分翼轸(zhěn)，地接衡庐。襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，','1701176517959','1697264268142',NULL,'2023-11-28 13:46:35','2023-11-28 13:46:35',NULL),('1701179205822','豫章故郡，洪都新府。星分翼轸(zhěn)，地接衡庐。襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，','1701176517959','1701177764743',NULL,'2023-11-28 13:46:45','2023-11-28 13:46:45',NULL),('1701179216503','豫章故郡，洪都新府。星分翼轸(zhěn)，地接衡庐。襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，','1701176517959','1701179107076',NULL,'2023-11-28 13:46:56','2023-11-28 13:46:56',NULL),('1701179229638','豫章故郡，洪都新府。星分翼轸(zhěn)，地接衡庐。襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，','1701176517959','1701178900100',NULL,'2023-11-28 13:47:09','2023-11-28 13:47:09',NULL),('1701179241652','临帝子之长洲，得天人之旧馆。层峦耸翠，上出重霄;飞阁流丹，下临无地。鹤汀(tīng)凫(fú )渚(zhǔ)，穷岛屿之萦(yíng)回；桂殿兰宫，即冈峦之体势。披绣闼(tà)，俯雕甍(méng )，山原旷其盈视，川泽纡(yū)其骇瞩。闾(lǘ)阎(yán) 扑地，钟鸣鼎食之家；舸(gě)舰弥津，青雀黄龙之舳(zhú)。云销雨霁(jì)，彩彻区明。落霞与孤鹜(wù)齐飞，秋水共长天一色。渔舟唱晚，响穷彭蠡(lǐ)之滨；雁阵惊寒，声断衡阳之浦。遥襟俯畅，逸兴遄(chuán)飞。爽籁发而清风生，纤歌凝而白云遏(è)。睢(suī)园绿竹，气凌彭泽之','1701176517959','1701178900100',NULL,'2023-11-28 13:47:21','2023-11-28 13:47:21',NULL),('1701179258670','犹欢。北海虽赊(shē)，扶摇可接；东隅(yú)已逝，桑榆非晚。孟尝高洁，空余报国之情;阮籍猖狂，岂效穷途之哭!勃，三尺微命，一介书生。无路请缨，等终军之弱冠;有怀投笔，慕宗悫(què)之长风。舍簪(zān)笏(hù)于百龄，奉晨昏于万里。非谢家之宝树，接孟氏之芳邻。他日趋庭，叨(tāo)陪鲤对；今兹(苏教版为“晨”)捧袂(mèi)，喜托龙门。杨意不逢，抚凌云而自惜;钟期既(苏教版为“相”)遇，奏流水','1701176517959','1701177618868',NULL,'2023-11-28 13:47:38','2023-11-28 13:47:38',NULL),('1701179426141','汉代的豫章旧郡，现在称洪都府。它处在翼、轸二星的分管区域，与庐山和衡山接壤。以三江为衣襟，以五湖为腰带，控制楚地，连接瓯越。这里地上物产的精华，乃是天的宝物，宝剑的光气直射牛、斗二星之间；人有俊杰是因为地有灵秀之气，','1695627840943','1697264268142',NULL,'2023-11-28 13:50:26','2023-11-28 13:50:26',NULL),('1701351606634','望的广远，扣紧秋日，景色鲜明；再从宴会娱游写到人生遇合，抒发身世之感；接着写作者的遭遇并表白要自励志节，最后以应命赋诗和自谦之','1701350273436','1697264013066',NULL,'2023-11-30 13:40:06','2023-11-30 13:40:06',NULL),('1701351612119','望的广远，扣紧秋日，景色鲜明；再从宴会娱游写到人