INSERT INTO `video` VALUES ('1697263947397','十年了！胡歌演唱《一吻天荒》带你回忆《轩辕剑之天之痕》','1695627840943','29','238608.027','《一吻天荒》\n作词：胡志敏、张畅\n作曲：万晨\n演唱：胡歌\n编曲：欧阳箐宇','1682755348953','2023-10-14 06:12:27','2024-02-13 07:23:41',1),('1697264013066','仙剑奇侠传：阿桑《一直很安静》神曲','1695627840943','54','247466','最近重看了一遍仙剑\n以前是喜欢灵儿，现在我更喜欢月如','1682755348953','2023-10-14 06:13:33','2024-02-11 13:07:58',1),('1697264201912','听琴声潇潇 该忘的忘不掉 红尘 困住我年少 《古剑奇谭》主题曲 《 剑心》','1695627840943','15','252400.249','紫胤真人在弟子继位就离开天墉城了，后来陵越师兄继位掌门，芙蕖师妹继位妙法长老，两个一直等屠苏，陵越收了一个眉间天生也有朱砂的弟子玉泱，这个弟子成了陵越后一任掌门的执剑长老。陵越自己给自己铸过一把渭水太极剑，卸任后在一个微雨夜后无疾而终','1682755374704','2023-10-14 06:16:41','2024-01-31 14:03:38',1),('1697264268142','特别的爱给特别的你—伍思凯 1990年十大中文金曲现场 ','1695627840943','47','305706.333','歌怎么说  好听 经典 但难度太大  一般歌手只翻唱高潮部分 结尾部分都是跳过要么降低难度随便胡弄过去  连伍思凯本人都已经唱不出结尾那种味道了','1682755348953','2023-10-14 06:17:48','2024-02-08 12:20:38',1),('1701177222724','《年少的你啊》以梦为马 不负韶华 这才是青春该有的样子','1701176517959','62','194629.388','不管他是不是裁缝，这首歌他能让我高兴，给我青春的气息，甚至给我力量，这难道不是创作歌曲最原本的初衷吗？\n我总觉得现在好多人对音乐的审美有一种莫名的畸形，好像好歌手永远都只有周杰伦陈奕迅这些老牌歌手，对于这些新生代歌曲总会用裁缝去诋毁。没错这旋律确实很像。你喜欢','1682755374704','2023-11-28 13:13:42','2024-02-11 03:36:10',0),('1701177618868','胡歌《忘记时间》经典神曲！《仙剑奇侠传三》片尾曲','1701176517959','34461','240810.333','前段时间，因为仙剑的视频原因，我也是非常非常头疼\n为了回应广大仙剑粉丝的要求，决定重新做一期仙剑\n这首胡歌的《忘记时间》是我非常喜欢的一首歌\n2022年马上就过去了，我想用这首歌来结束今年，这首歌包含了很多\n祝大家在新的一年，都能够开开心心','1682755348953','2023-11-28 13:20:18','2024-01-11 13:23:33',1),('1701177764743','在你的身边》-盛哲','1701176517959','25','262361.61','安静地又说分开\n\n没有依赖却是太多依赖\n\n寂寞的广场中央\n\n是谁的对白追赶我的空白\n\n爱就爱了不怕没来过\n\n恨就恨了我从没想过\n\n是怕独念一个人太深刻\n\n爱就爱了不怕没来过\n\n恨就恨了我从没想过\n\n到过的地方熟悉曾经的模样\n\n我以为忘了想念','1682755348953','2023-11-28 13:22:44','2024-01-08 13:11:01',0),('1701178344369','“在星空的另一端，思念从未停止！”《我记得》','1701176517959','10','322153.22','“世间是一个轮回，离开我们的人，在另一个时空，我们总会失忆着相遇！”','1682755348953','2023-11-28 13:32:24','2024-01-16 13:03:26',1),('1701178696753','童年你慢些走。我快跟上你了','1701176517959','123241','66687.007','童年你慢些走。我快跟上你了','1682755374704','2023-11-28 13:38:16','2024-01-16 13:29:03',1),('1701178900100','以为长大只是一场梦。原来童年才是。','1701176517959','108','65016.009','以为长大只是一场梦。原来童年才是。','1682755348953','2023-11-28 13:41:40','2024-02-13 07:23:36',1),('1701179107076','看过七龙珠的都多大了？ ','1701176517959','148','80500','看过七龙珠的都多大了？ ','1682755348953','2023-11-28 13:45:07','2024-02-13 07:41:13',1),('1701179759725','这么甜的歌，确定不艾特喜欢的人一起听#音乐分享#youi#脸红的思春期some#韩语歌','1701179513883','81','23500','这么甜的歌，确定不艾特喜欢的人一起听#音乐分享#youi#脸红的思春期some#韩语歌','1682755374704','2023-11-28 13:55:59','2024-02-13 07:11:34',1),('1701350566667','BLACKPINK《Lovesick Girls》超辣私服练习室！','1701350273436','125','197973.197','这次专辑四个人状态都好好，智秀比想象的更适合这次回归，妮的嗓音和肉配合的尤为反差太爱了，lisa这次rap和vocal双满足，还有妮的平刘海好好看啊不一样的感觉','1682755239801','2023-11-30 13:22:46','2024-02-13 07:23:28',1),('1701350878244','《帝 王 引 擎II》','1701350273436','53','368849.252','《帝 王 引 擎II》','1682755203328','2023-11-30 13:27:58','2024-01-31 14:03:33',1),('1701352079463','郁可唯 -《水中花》致敬谭咏麟 灵动飘渺的声音，穿梭在摇晃的芦苇间','1701350273436','94','226765.21500000003','今天整期氛围都好棒 开头左麟右李亦师亦友的故事奠定了基调 有种华语乐坛传承的味道..后辈们在大前辈面前带着敬意翻唱大前辈的歌 带着各自独属于自己的故事和理解  马..咳 湖南台你认真做不搞事情不瞎剪还是很会做好节目的啊。','1701351191589','2023-11-30 13:47:59','2024-02-11 03:25:58',1),('1701352530518','田小娟\'BEAM BEAM\'','1701350273436','164','172330.33299999998','田小娟\'BEAM BEAM\'','1701351191589','2023-11-30 13:55:30','2024-02-13 07:11:04',0),('1701438826139','c罗经典20球11','1695627840943','9','602000','C罗转会曼联！离别12载，终于荣归故里，重返老特拉福德！','1682755318948','2023-12-01 13:53:46','2024-01-05 16:09:30',1),('1701443899564','【(G)I-DLE】[M/V] - \'TOMBOY\'','1695627840943','74','197269','稍微了解一点女娃的都会知道这一路走过来都经历了什么。非三大出生，队长呆在房间里三天哭着写完出道曲才允许出道，就连logo都是自己设计。从最开始的不被看好，到一线成绩，女娃永远在创造奇迹。为什么我这么相信娃呢，因为gidle靠的从来不是公司，不是营销，甚至不是粉丝，而是自己','1682755374704','2023-12-01 15:18:19','2024-02-13 07:23:21',0),('1701499667928','Zedd&Selena Gomez-I Want You To Know(无损发烧音质4K60MV)[中英字幕]Hi-Res','1701180369121','93','246799','官方原版MV提升画质至4K60，音频为Hi-Res无损PCM24bits96kHz发烧级音质，简体中文和英文字幕，无任何水印，完美极限体验！！','1682755335314','2023-12-02 06:47:47','2024-02-13 07:05:30',1),('1701500752272','曲婉婷 - 没有什么不同','1701180369121','29','264791','知乎上有一个问题“如何评价曲婉婷？”有一个回答得到了三万五千多人的点赞，却被禁止评论，原文如下：\n不能客观公众的评价她。\n我生活于东北，我的舅舅是下岗工人，下岗以后没工作，没学历，只能去给别人送水，一桶20公斤的水，从一楼搬到6楼，3块钱，一个月1500，养老婆，养女儿。贫贱夫妻百事哀，舅妈天天嫌弃他不挣钱，家里能吃顿肉也是一件喜事。前几年我舅检查出脑梗，上午和我妈去办理住院，下午又偷偷溜回家，给我妈打电话：姐，我还是不治了，我没钱。当时我妈的眼泪就下来了。去年过年的时候，喝了点酒脑溢血走了。我妈妈说，他40多年的苦也算是吃到头了，就像新闻上一样，生病的下岗工人只能自杀，在我们这样的地方，好像脱离苦海唯一的办法只有死亡','1701351191589','2023-12-02 07:05:52','2024-01-08 13:51:00',0),('1701501038634','危险派对 - 王以太/刘至佳『左手保护你的腰 不会碰到你的背','1701180369121','39','180743.469','危险派对 - 王以太/刘至佳『左手保护你的腰 不会碰到你的背','1682755374704','2023-12-02 07:10:38','2024-01-11 11:17:04',0),('1701861942912','米津玄師『Lemon』 MV 1080P','1701861356232','71','274407.325','日剧《非自然死亡》主题曲','1701351191589','2023-12-06 11:25:42','2024-02-13 07:23:09',0),('1702044791168','《音乐MV》王招君 (你看你拉住我的模样)-任素汐','1701179513883','158','262314.5','你看时间朗朗有光照，你看我盼着你的模样，看满荒唐写纸上。\n','1682755348953','2023-12-08 14:13:11','2024-02-13 07:23:12',0),('1702044953554','潘玮柏&苏芮 - 我想更懂你','1701179513883','110','267600','一位母亲对一个叛逆儿子的期望！但是儿子不理解作为母亲的苦心，儿子也希望母亲理解他！但是事实就是这样，沟通少才造成很多的阻碍和隔阂.','1701351191589','2023-12-08 14:15:53','2024-01-31 14:02:17',0),('1703944636871','拉丁舞世界冠军的《科目三》','1701176517959','143','47577.256','觉得咱们觉得土只是因为母语羞耻而已，外国人根本听不懂这首歌，就像你偶然听到一首曲调奇异的法语歌或者德语歌，就会觉得还挺不错','1682755348953','2023-12-30 13:57:16','2024-02-13 07:22:01',0),('1703945014268','名侦探柯南主题曲《转动命运之轮》现场——坂井泉水','1701176517959','71','232917','《转动命运之轮》（《運命のルーレット廻して》）为ZARD的第25张单曲。在前作的基础上继续为动画演唱歌曲，自己第一次为《名侦探柯南》演唱歌曲。在2007年ZARD受欢迎单曲排行榜中，继续达到百万以上销量的3张作品之后，此曲获得第四名，到现在人气依然很高','1682755260010','2023-12-30 14:03:34','2024-02-13 07:23:17',0),('1704722402162','IDLE “Queencard“现场live','1701179513883','95','166762.16700000002','IDLE “Queencard“现场live','1701351191589','2024-01-08 14:00:02','2024-02-12 11:54:45',0),('1705134899610','这么甜的一首歌，快@你最爱的人一起来听吧','1702194200156','43','173546.5','甜歌《微微》','1704527598715','2024-01-13 08:34:59','2024-02-11 02:41:39',0),('1707533674179','超清60帧 BLACKPINK - As If It\'s Your Last 人气歌谣 170716','1702194200156','28','212991.833','原来不认识粉墨，偶然听到这首歌是真的好听，还有口哨内首歌，dudu啊内首歌都没吸引到我，这首歌在手机里循环了好几遍，尤其珍妮和lisa那里觉得特别好听，智秀长的是挺好看，但是更喜欢lisa这种长相的，大眼睛布灵布灵滴','1682755239801','2024-02-10 02:54:34','2024-02-13 07:23:00',0),('1707534418370','\'AS IF IT\'S YOUR LAST\' MV 粉墨官方音乐MV视频','1702194200156','21','216966.825','感觉jennie 和lisa任何时期都挺亮眼 她俩确实很有yg的sence 比其他两个有气场 舞蹈基础也强 说句客观的不管妆造如何在她们团里她俩就是最亮眼的','1682755239801','2024-02-10 03:06:58','2024-02-11 14:35:54',0),('1707656515548','中岛美嘉 -《曾经我也想过一了百了》MV','1695627840943','24','386709','中岛美嘉 -《曾经我也想过一了百了》MV','1704527598715','2024-02-11 13:01:55','2024-02-13 07:22:49',0),('1707659651443','在澳洲街头唱杰伦的中国风饶舌《本草纲目》是一种什么体验','1701180369121','10','60557','在澳洲街头唱杰伦的中国风饶舌《本草纲目》是一种什么体验','1704527598715','2024-02-11 13:54:11','2024-02-13 07:21:40',0),('1707743066504','《山楂树之恋》程佳佳【HIRES无损音质】','1695627840943','3','184596.833','我的山楂树之恋\n\n永远站在你的身边\n\n我保证我的爱不会变\n\n共享永恒时间\n\n像蝴蝶起舞翩翩\n\n每次懊恼在于相见恨晚\n\n不管相隔的距离是长\n\n或是短\n\n能在一起的时候不要快只想慢\n\n想和你有个孩子','1701351191589','2024-02-12 13:04:26','2024-02-13 07:21:37',0),('1707743405945','风靡全球的英文歌《Love Me Like You Do》，旋律动人，听到陶醉','1701861356232','4','238320','风靡全球的英文歌《Love Me Like You Do》，旋律动人，听到陶醉','1704527598715','2024-02-12 13:10:05','2024-02-13 07:21:30',0),('1707743634495','Wolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena ','1701861356232','9','198101','Wolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena GomezWolves - Selena Gomez','1682755374704','2024-02-12 13:13:54','2024-02-13 07:22:52',0);
